class BpmnJsonParser {
    // eslint-disable-next-line @typescript-eslint/no-explicit-any
    static parse(json) {
        const jsonConvert = JsonParser.getInstance().jsonConvert;
        const definitions = jsonConvert.deserializeObject(json.definitions, Definitions);
        return definitions.bpmnModel;
    }
}

class BpmnParser {
    // TODO inner parsers should be injected
    parse(bpmnAsXml) {
        const json = new BpmnXmlParser().parse(bpmnAsXml);
        return BpmnJsonParser.parse(json);
    }
}

